import AnimatedButton from './catapp_components/AnimatedButton';
import './css/styles-game.css';
import './css/styles.css';

const CatMenu = () => {

    return (
        <div id="cat-info-buttons">
        <AnimatedButton divID="cib1" imgSrc="/imgs/Button Create V2.png"/>
        <AnimatedButton divID="cib2" imgSrc="/imgs/Button Feed V2.png"/>
        <AnimatedButton divID="cib3" imgSrc="/imgs/Button Play V2.png"/>
        <AnimatedButton divID="cib4" imgSrc="/imgs/Button Dress V2.png"/>
    </div>
    );

}

export default CatMenu;
